@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'app';
}
<!DOCTYPE html>
<HTML>
  <head>
    <style>
      body{
        margin:0;
        padding:0;
      }
      .navbar{

        background-color: pink;
        border: 1px solid;
        border-color: black;

      }
    </style>  
  </head>
